import React from 'react';
import './header.scss';
import { Link } from 'react-router-dom';

const logo = require('../../assets/silontong.png');
const Header = () => {
	return (
		<div className="header">
			<Link to="/">
      <div className="outline-logo">	
					<img src={logo} alt="logo" className="logo" />
			</div>
      </Link>
		</div>
	);
};

export default Header;
